import React from 'react'
import styled from 'styled-components'

function App() {
    return (
        <MainContainer>
            <h1>hello world</h1>
        </MainContainer>
    )
}

export default App

const MainContainer = styled.div`
min-height: 300vh;
width: 100%;

background-color: gray;

display: flex;

`
